import React from "react";
import styled from "styled-components";
import PropTypes from "prop-types";
import { useRouter } from "next/router";

import { NavLinks } from "../../UI/Links";

export const PageTitle = ({ title, links }) => {
  return (
    <Context>
      <Title>{title}</Title>
      <Links>
        {links.map((item, index) => (
          <NavLinks key={index} href={item.href}>
            {item.name}
          </NavLinks>
        ))}
      </Links>
    </Context>
  );
};

export const Breadcrumbs = ({ title, paths, links }) => {
  const router = useRouter();
  console.log(router.back);
  return (
    <Context>
      <div onClick={() => router.back}>
        <Title>{title}</Title>
      </div>
      <Links>
        {/* {links.map((item) => (
          <NavLinks href={item.href}>{item.name}</NavLinks>
        ))} */}
      </Links>
    </Context>
  );
};

const Links = styled.div`
  display: grid;
`;

const Title = styled.h5`
  display: grid;
`;

const Context = styled.div`
  display: grid;
  padding: 0 ${({ theme }) => theme.paddingW};

  @media screen and (min-width: ${({ theme }) => theme.mq.tablet}) {
    grid-template-columns: auto 25%;
    align-items: baseline;
  }
`;

PageTitle.propTypes = {
  title: PropTypes.string,
  links: PropTypes.array,
};
